
public class Buzz12 {

	public static void main(String[] args) {
	 for(int x=0; x<=100; x++){
		 if(x%3==0)
			 System.out.println("FIZZ");
		 if(x%5==0)
			 System.out.println("BUZZ");
		 
		 if(x%3==0&&x%5==0)
			 System.out.println("FIZZ BUZZ ");
		 else 
			 System.out.println(x);
			 
	 }
		
		// TODO Auto-generated method stub

	}

}
